export default function Properties() {
	return (
		<div className="container d-flex-column text-center mt-5">
			<h4>Properties</h4>
			<br />
			<p>Free Wifi</p>
			<p>Food Included</p>
			<p>Service Tax Excluded</p>
			<p>Scenery</p>
		</div>
	);
}
